import Navbar from "./components/Navbar.js";
import Home from "./components/Home";
import {BrowserRouter as Router, Switch, Route}  from "react-router-dom";
import Blogs from "./components/Blogs";

import "./styles.css";

 function App() {

  return (
    <>
    <Router>
    <Navbar />
    <Switch>
      <Route path='/' exact />
      </Switch>
    </Router>
      <Home />

      </>
  );
}
export default App;
